import React from 'react';
import { Tabs, TabNav, TabNavItem, TabContent, TabPanel } from 'react-smarttab'

class MainTabNav extends React.Component{
  render() {
    return (
      <div>
       <Tabs>
         <TabNav>
           <TabNavItem>

           </TabNavItem>
         </TabNav>

         <TabContent>
           <TabPanel>

           </TabPanel>
         </TabContent>
       </Tabs>
      </div>
    )
  }
}
export default MainTabNav
